We continue to celebrate Latino Heritage Month, and today, we are highlighting entrepreneurs from the community who are making a difference!

Check out the work of Iris Gutierrez, Zakruu; @_zakruu is a family-owned clothing and accessories business started by Zapotec women to celebrate their Oaxacan indigenous roots with a twist of modernism;

Kevin Valle, Taco 'Bout Amazing!; @tacoboutamazing is a family-owned authentic Mexican catering service. If you are looking for amazing food for your parties and events, reach out to @tacoboutamazing;

And Elmer Garcia & Barbara Guilién, Transform Fitness; Transform Fitness is a family-owned fitness center located at 2601 Van Buren Pl. Los Angeles, CA 90007. Book your next training session with @barbara_guilien.

@seiuuhw is on the final day of the largest healthcare strike in US history. If you haven’t stopped by the picket lines, drop by a Kaiser near you.

Standing in solidarity with SEIU-UHW and all the healthcare workers on strike at Kaiser as they fight for a fair contract!

Our healthcare workers play a vital role in keeping both our City and our communities safe and functioning. That is why we must get these workers the pay they deserve!

@Metrolink and Arrow trains will be out of service for four days, from Tuesday, December 26, through Friday, December 29. They will resume their regularly scheduled service on Saturday, December 30. While the trains rest, the plan is to clean, repair and upgrade our City's rail network.

Metrolink is not providing alternative transportation, but they're collaborating with several transportation agencies to ensure you have alternatives during this period. 

